# PIXTOOL PRO 2026 - QUANTUM PASSWORD GENERATOR
# AUTHOR: OMER CATALOGLU
# TYPE: POWERSHELL SCRIPT

$Host.UI.RawUI.WindowTitle = "PixTool Pro 2026 - Quantum Password Generator"
[Console]::OutputEncoding = [System.Text.Encoding]::UTF8

# --- GORSEL FONKSIYONLAR ---
function Show-Header {
    Clear-Host
    Write-Host " ===========================================================================" -ForegroundColor Cyan
    Write-Host "  PIXTOOL PRO 2026 - KUANTUM SIFRE URETICI (MILITARY GRADE)" -ForegroundColor White
    Write-Host " ===========================================================================" -ForegroundColor Cyan
    Write-Host "  Gelistirici : Omer Cataloglu" -ForegroundColor Gray
    Write-Host "  Algoritma   : AES-256 Standartlarinda Kriptografik Rastgelelik" -ForegroundColor Gray
    Write-Host " ===========================================================================" -ForegroundColor Cyan
    Write-Host ""
}

function Generate-SecurePassword {
    param([int]$Length, [bool]$Special, [bool]$Numbers)

    # Karakter Setleri
    $chars = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ"
    if ($Numbers) { $chars += "0123456789" }
    if ($Special) { $chars += "!@#$%^&*()_+-=[]{}|;:,.<>?" }

    # Kriptografik Rastgele Sayı Üreteci (RNG)
    $rng = [System.Security.Cryptography.RandomNumberGenerator]::Create()
    $bytes = New-Object byte[] $Length
    $rng.GetBytes($bytes)

    $result = ""
    foreach ($b in $bytes) {
        $result += $chars[$b % $chars.Length]
    }
    return $result
}

function Animate-Generation {
    param($TargetPassword)
    $chars = "abcdefghijklmnopqrstuvwxyz0123456789!@#$%^&*"
    $random = New-Object System.Random

    Write-Host " [ISLEM] Entropi havuzu karistiriliyor..." -ForegroundColor Yellow
    Start-Sleep -Milliseconds 500
    Write-Host " [ISLEM] Kuantum bitleri esleniyor..." -ForegroundColor Yellow
    Write-Host ""

    # Matrix Efekti
    for ($i = 0; $i -lt 15; $i++) {
        $temp = ""
        for ($j = 0; $j -lt $TargetPassword.Length; $j++) {
            $temp += $chars[$random.Next($chars.Length)]
        }
        Write-Host -NoNewline "`r  GENERATING: $temp" -ForegroundColor DarkGreen
        Start-Sleep -Milliseconds 50
    }
    Write-Host -NoNewline "`r  GENERATING: " -ForegroundColor DarkGreen
    Write-Host "$TargetPassword" -ForegroundColor Green
    Write-Host ""
}

# --- ANA DONGU ---
while ($true) {
    Show-Header

    # Varsayılan Ayarlar
    Write-Host "  [1] Standart Guvenlik (16 Karakter - Sayi/Sembol)" -ForegroundColor Yellow
    Write-Host "  [2] Yuksek Guvenlik   (32 Karakter - Sayi/Sembol)" -ForegroundColor Yellow
    Write-Host "  [3] PIN Kodu          (6 Hane - Sadece Sayi)" -ForegroundColor Yellow
    Write-Host "  [4] Ozel Uzunluk Belirle" -ForegroundColor Yellow
    Write-Host "  [Q] Cikis" -ForegroundColor Red
    Write-Host ""

    $choice = Read-Host "  -> Seciminiz"

    if ($choice -eq "Q") { break }

    $len = 16
    $useSpec = $true
    $useNum = $true

    switch ($choice) {
        "1" { $len = 16 }
        "2" { $len = 32 }
        "3" { $len = 6; $useSpec = $false; $chars = "0123456789" } # PIN Ozel
        "4" { 
            $inputLen = Read-Host "  -> Uzunluk Girin (Orn: 24)"
            if ($inputLen -match "^\d+$") { $len = [int]$inputLen }
        }
    }

    # PIN modu icin ozel durum (Sadece sayi olmali, yukaridaki switch tam kapsamazsa diye)
    if ($choice -eq "3") {
        # Basit PIN uretimi
        $rng = [System.Security.Cryptography.RandomNumberGenerator]::Create()
        $bytes = New-Object byte[] $len
        $rng.GetBytes($bytes)
        $finalPass = ""
        foreach ($b in $bytes) { $finalPass += ("0123456789")[$b % 10] }
    } else {
        $finalPass = Generate-SecurePassword -Length $len -Special $useSpec -Numbers $useNum
    }

    # Animasyon ve Sonuç
    Write-Host ""
    Animate-Generation -TargetPassword $finalPass

    # Pano İşlemi
    Set-Clipboard $finalPass

    Write-Host ""
    Write-Host "  [BASARILI] Sifre panoya kopyalandi!" -ForegroundColor Cyan
    Write-Host "  -----------------------------------------------------------" -ForegroundColor DarkGray

    $cont = Read-Host "  Yeni sifre icin ENTER, cikmak icin Q"
    if ($cont -eq "Q") { break }
}
